    false,nt"url": null,nt"notes": "This annual narrative report for Malheur
    NWR outlines Refuge accomplishments during the 1996 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses management planning,
    compliance with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, safety, and technical assistance is given. Habitat
    management is also covered; subjects include wetlands, croplands, grasslands, grazing,
    haying, fire management, pest control, water rights, and private lands. The wildlife
    section of the report discusses wildlife diversity, endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries
    resources, marking and bird banding, and disease control. The public uses of the
    Refuge described in this report include outdoor classrooms, interpretive programs,
    hunting, fishing, and law enforcement. The equipment and facilities section of the
    report provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, and computer systems. Cooperative programs and items of interest
    are provided at the end. Refuge brochures are attached.",nt"license_title":
